import React from 'react';
import './Boxes.css';

const Boxes = ({box}) => {
    const box2 = {}
    console.log("Hi")
    console.log(Object.keys(box).length)
    box2=box
    if (Object.keys(box).length > 0){
        box2 = box[0].region_info.bounding_box
    }
    // [0].region_info.bounding_box
    return(
        <div 
            className='peter' 
            style={{
                top:box2.topRow, 
                right: box2.rightCol, 
                left: box2.leftCol, 
                bottom:box2.bottomRow
            }}
        ></div>
    )
} 

export default Boxes;
